function effaceImagesTomoGap () {
	for (var i=0;i<3;i++) {
			tImageBandeauGap[i].width=0;
			tImageBandeauGap[i].height=0;
	}
	canvTempBandeauG.width=0;
	canvTempBandeauG.height=0;
}

function preCalcTomoGap (){
	var id;
	for (var i=0;i<10;i++) {
		imageDataAnomGap[i]=new Uint8Array(165888); // 576*288
		ctxTempBandeauG.drawImage (tImageBandeauGap[0],0,288*i,576,288,0,0,576,288);
		id=ctxTempBandeauG.getImageData(0,0,576,288).data; //.filter(function (el, index, arr) {
		for (var j=0;j<165888;j++) {
			imageDataAnomGap[i][j]=id [j<<2]; //division par 4
		}
		// filtrer diviser par 4 la taille du imagedata ... mais est  long
		if (i==0) {// on sauvegarde la couche 0 dans une image
			ctxTempBandeauG.clearRect (0,0,576,288);
			ctxTempBandeauG.drawImage (tImageBandeauGap[0],288,0,288,288,0,0,288,288);
			ctxTempBandeauG.drawImage (tImageBandeauGap[0],0,0,288,288,288,0,288,288);
			imageLayer0GapP4.src = canvTempBandeauG.toDataURL("image/png");
		} 
	}
	for (var i=10;i<20;i++) {
		imageDataAnomGap[i]=new Uint8Array(165888);
		ctxTempBandeauG.drawImage (tImageBandeauGap[1],0,288*(i-10),576,288,0,0,576,288);
		id=ctxTempBandeauG.getImageData(0,0,576,288).data; 
		for (var j=0;j<165888;j++) {
			imageDataAnomGap[i][j]=id [j<<2];
		}
	}
	for (var i=20;i<29;i++) {
		imageDataAnomGap[i]=new Uint8Array(165888);
		ctxTempBandeauG.drawImage (tImageBandeauGap[2],0,288*(i-20),576,288,0,0,576,288);
		id=ctxTempBandeauG.getImageData(0,0,576,288).data; 
		for (var j=0;j<165888;j++) {
			imageDataAnomGap[i][j]=id [j<<2];
		}
	}
	id.length=0;	
}


	
function getAnomFromBandeauGap (lati,longi,tranche) {
	if (tranche<1) {return 0;}
	if (tranche>29) {tranche=29;}
	if (longi<0) {longi+=360;}
	lati=90-lati;
	var x=Math.round(longi*1.6);
	var y=Math.round(lati*1.6);
	var n=(x+y*576); 
	var c=imageDataAnomGap[tranche-1][n];
	//console.log (x+" "+y+" "+n+" "+c);
	var v=(c-128)/16; //16
	return v;
}

